import React from 'react';
import Highlight from '../../components/Highlight';
import WebDevelopment from '../../assets/svg/web-development.svg';
import UI from '../../assets/svg/uiux.svg';
import Analytics from '../../assets/svg/analytics.svg';
import Management from '../../assets/svg/concept.svg';
import Separator from '../Separator';
import styles from './Highlights.module.scss';

const { container, icon, highlights } = styles;

const Highlights = () => {
  return (
    <div className={container}>
      <h2>Highlights</h2>
      <Separator />
      <div className={highlights}>
        <Highlight
          icon={<WebDevelopment className={icon} />}
          title="Web development"
          description="Software developer focusing on the web industry"
        />
        <Highlight
          icon={<UI className={icon} />}
          title="Optimising UI and UX"
          description="My strength lies in front-end programming. I have a good eye for design "
        />
        <Highlight
          icon={<Analytics className={icon} />}
          title="Analytics and reporting"
          description="I want to make conceus decitions."
        />
        <Highlight
          icon={<UI className={icon} />}
          title="Product/project management"
          description="I want to link priorities to the organization's vision, strategy and goals. I am organized with a good experience using Scrum"
        />
        <Highlight
          icon={<UI className={icon} />}
          title="Entrepreneur and innovation"
          description="Creative and encouraging those I work with to express their views so we can optimize ideas together."
        />
        <Highlight
          icon={<UI className={icon} />}
          title="Team player"
          description="Positive atmosphere along with the group of people I work with is crucial."
        />
      </div>
    </div>
  );
};

export default Highlights;
